        public Dictionary<FormKey, IMajorRecordCommon> CopyInDuplicate(
            SkyrimMod rhs,
            GroupMask mask = null)
        {
            var duppedRecords = new List<(IMajorRecordCommon Record, FormKey OriginalFormKey)>();
            if (mask?.GameSettings ?? true)
            {
                this.GameSettings.Items.Set(
                    rhs.GameSettings.Items.Values
                        .Select(i => i.Duplicate(this.GetNextFormKey, duppedRecords))
                        .Cast<GameSetting>());
            }
            if (mask?.Keywords ?? true)
            {
                this.Keywords.Items.Set(
                    rhs.Keywords.Items.Values
                        .Select(i => i.Duplicate(this.GetNextFormKey, duppedRecords))
                        .Cast<Keyword>());
            }
            if (mask?.LocationReferenceTypes ?? true)
            {
                this.LocationReferenceTypes.Items.Set(
                    rhs.LocationReferenceTypes.Items.Values
                        .Select(i => i.Duplicate(this.GetNextFormKey, duppedRecords))
                        .Cast<LocationReferenceType>());
            }
            if (mask?.Actions ?? true)
            {
                this.Actions.Items.Set(
                    rhs.Actions.Items.Values
                        .Select(i => i.Duplicate(this.GetNextFormKey, duppedRecords))
                        .Cast<ActionRecord>());
            }
            if (mask?.TextureSets ?? true)
            {
                this.TextureSets.Items.Set(
                    rhs.TextureSets.Items.Values
                        .Select(i => i.Duplicate(this.GetNextFormKey, duppedRecords))
                        .Cast<TextureSet>());
            }
            if (mask?.Globals ?? true)
            {
                this.Globals.Items.Set(
                    rhs.Globals.Items.Values
                        .Select(i => i.Duplicate(this.GetNextFormKey, duppedRecords))
                        .Cast<Global>());
            }
            if (mask?.Classes ?? true)
            {
                this.Classes.Items.Set(
                    rhs.Classes.Items.Values
                        .Select(i => i.Duplicate(this.GetNextFormKey, duppedRecords))
                        .Cast<Class>());
            }
            Dictionary<FormKey, IMajorRecordCommon> router = new Dictionary<FormKey, IMajorRecordCommon>();
            router.Set(duppedRecords.Select(dup => new KeyValuePair<FormKey, IMajorRecordCommon>(dup.OriginalFormKey, dup.Record)));
            foreach (var rec in router.Values)
            {
                foreach (var link in rec.Links)
                {
                    if (link.FormKey.ModKey == rhs.ModKey
                        && router.TryGetValue(link.FormKey, out var duppedRecord))
                    {
                        link.FormKey = duppedRecord.FormKey;
                    }
                }
            }
            var package = new LinkingPackage<SkyrimMod>(this, default);
            foreach (var rec in router.Values)
            {
                foreach (var link in rec.Links)
                {
                    link.Link(package);
                }
            }
            return router;
        }

